  AR_A: { gameId: "AR_A", name: "Salta" },
  AR_B: { gameId: "AR_B", name: "Buenos Aires" },
  AR_C: { gameId: "AR_C", name: "Ciudad de Buenos Aires" },
  AR_D: { gameId: "AR_D", name: "San Luis" },
