  AR_L: { gameId: "AR_L", name: "La Pampa" },
  AR_M: { gameId: "AR_M", name: "Mendoza" },
  AR_N: { gameId: "AR_N", name: "Misiones" },
  AR_P: { gameId: "AR_P", name: "Formosa" },
